webpackJsonp([95594892322560],{6980:function(e,t){e.exports={data:{post:{html:'<p><a href="http://www.leinie.com/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/08/leinie.jpg" alt="Leinenkugel\'s" align="right" border="0" /></a><a href="http://archive.scripting.com/2004/08/26#When:7:24:18AM">Dave Winer is in Madison WI</a> and looking forward to drinking <a href="http://www.leinie.com/">Leinenkugel\'s</a>.  Nice to see they have good taste in Madison. Leinenkugel\'s comes from Chippewa Falls, which is also the birthplace of Seymour Cray, founder of Cray Research. A college buddy of mine who worked for Cray told me they used to include a case of Leinenkugel\'s with every Cray shipped. Now that I\'m a sys admin, I can better appreciate that.</p>',fields:{title:"Case Modding",date:"26 Aug 2004",url:"https://papascott.de/2004-08-26-case-modding/"}}},pathContext:{slug:"/2004-08-26-case-modding/",prev:{fields:{title:"Carrie Tollefson, Up Close and Personal",date:"24 Aug 2004",slug:"/2004-08-24-up-close-and-personal/"}},next:{fields:{title:"Communists for KERRY 2004",date:"26 Aug 2004",slug:"/2004-08-26-communists-for-kerry-2004/"}}}}}});
